import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { Provider } from "react-redux";
import * as serviceWorker from "./serviceWorker";
import { createStore } from "redux";
import registerFlightReducer from "./reducers/registerFlightReducer";
import registerFlight from "./actions/registerFlight";

// store
const store = createStore(registerFlightReducer);
// dispatch register Flight

const dispatchRegisterFlight = flightObject => {
  store.dispatch(registerFlight(flightObject));
};

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,

  document.getElementById("root")
);

serviceWorker.unregister();
